import styles from './index.module.scss'
import topBarStyles from '../../styles/topbar.module.scss'
import { For, Show, createEffect, createSignal, onMount } from 'solid-js'
import { createStore } from 'solid-js/store'
import { Group } from '../../models/group'
import { useFiles, useStore } from '../../App'
import { Member } from '../../models/member'
import { Place } from '../../models/place'
import { Routes } from '../../enums'
import { ElementEvent } from '../../types'
import { History } from '../../models/history'
import { invoke } from '@tauri-apps/api'
import { save } from '@tauri-apps/api/dialog'

export default () => {
    const files = useFiles()!
    const [isInitialize, setIsInitialize] = createSignal<boolean>(true)
    const [store, setStore] = useStore()!
    const [groups, setGroups] = createStore<Group[]>([])
    const [backupMembers, setBackupMembers] = createStore<Member[]>([])
    const [isLoading, setIsLoading] = createSignal<boolean>(true)
    const [isCopiedAll, setIsCopiedAll] = createSignal<boolean>(false)

    function goToHomePage() {
        setStore('route', Routes.home)
    }

    function addToHistory() {
        const history: History[] = isInitialize()
            ? [new History(groups, new Date()), ...store.history]
            : [...store.history].splice(0, 1, new History(groups, new Date()))
        setStore('history', history)
        files.history.setCache('history', history.map(v => v.toJSON()))
        files.history.syncCache()
    }

    function copyAll() {
        const text: string = groups.map(g => g.place.name + '\n' + g.members.map(m => '• ' + m.name).join('\n')).join('\n\n')
        navigator.clipboard.writeText(text).then(_ => {
            setIsCopiedAll(true)
            setTimeout(() => {
                setIsCopiedAll(false)
            }, 2E3)
        })
    }

    function copy(event: ElementEvent<HTMLDivElement>, index: number): void {
        const element = event.currentTarget
        if (event.target.getAttribute('data-copied'))
            return

        const text: string = groups[index].place.name + '\n' + groups[index].members.map(m => '• ' + m.name).join('\n')
        navigator.clipboard.writeText(text).then(_ => {
            element.setAttribute('data-copied', '')
            setTimeout(() => {
                element.removeAttribute('data-copied')
            }, 2E3)
        })
    }

    function print(): void {
        window.print();
    }

    function swapArrayElements<T>(array: Array<T>, index1: number, index2: number): Array<T> {
        let temp = array[index1];
        array[index1] = array[index2];
        array[index2] = temp;
        return array
    }

    function generateRandom(): void {
        if (!isLoading()) return

        let members: Member[] = [...backupMembers]
            .map(value => ({ v: value, rN: Math.random() }))
            .sort((a, b) => a.rN - b.rN)
            .map(({ v }) => v)
        const _groups: Group[] = []
        const places: Place[] = [...store.data.places]
        let isLimitedQuota: boolean = true
        let minPlaceQuota: number = 0
        let maxPlaceQuota: number = 0

        for (const place of store.data.places) {
            minPlaceQuota += place.minMembers
            maxPlaceQuota += Math.max(place.minMembers, place.maxMembers)

            if (isLimitedQuota)
                isLimitedQuota = place.isLimited
        }

        // Get member with fixed place
        for (const place of places) {
            const _members: Member[] = []
            const _membersIds: number[] = []

            for (const member of members) {
                if (_members.length == place.minMembers)
                    break

                if (member.fixedPlaceId == place.id) {
                    _members.push(member)
                    _membersIds.push(member.id)
                }
            }

            members = members.filter(member => !_membersIds.includes(member.id))
            _groups.push(new Group(_members, place))
        }

        // Get member for minimum member place (if member never in the place before)
        for (const group of _groups) {
            const _members: Member[] = []
            const _membersIds: number[] = []

            for (let member of members) {
                if (_members.length == group.place.minMembers)
                    break

                if (!member.lastPlacesIds.includes(group.place.id)) {
                    _members.push(member)
                    _membersIds.push(member.id)
                }
            }

            members = members.filter(member => !_membersIds.includes(member.id))
            group.members = [
                ...group.members,
                ..._members
            ]
        }

        // Get member for minimum member place (if minimum not filled yet)
        for (const group of _groups) {
            if (group.members.length < group.place.minMembers) {
                const max: number = group.place.minMembers - group.members.length
                let _members: Member[] = []
                let _membersIds: number[] = []
                for (let member of members) {
                    if (_members.length == max)
                        break
                    _members.push(member)
                    _membersIds.push(member.id)
                }

                if (_members.length < max)
                    _members = [
                        ..._members,
                        ...new Array(max - _members.length)
                            .fill(1)
                            .map(_ => new Member(-1, '', null, null))
                    ]

                members = members.filter(member => !_membersIds.includes(member.id))
                group.members = [
                    ...group.members,
                    ..._members
                ]
            }
        }

        // Get member for place member (if member not empty)
        for (const member of [...members]) {

            let isChoosen: boolean = false

            for (let i = 0; i < _groups.length; i++) {
                const group: Group = _groups.at(i)!
                if (!group.isFull && !member.lastPlacesIds.includes(group.place.id)) {
                    group.members.push(member)
                    members = members.filter(_member => _member.id != member.id);
                    isChoosen = true
                    swapArrayElements<Group>(_groups, i, _groups.length-1)
                    break;
                }
            }

            if (!isChoosen){
                for (let i: number = 0; i < _groups.length; i++) {
                    const group: Group = _groups.at(i)!
                    if (!group.isFull) {
                        group.members.push(member)
                        members = members.filter(_member => _member.id != member.id);
                        swapArrayElements<Group>(_groups, i, _groups.length-1)
                        break;
                    }
                }
            }
        }

        if (isLimitedQuota && members.length > 0) {
            _groups.sort((a, b) => b.members.length - a.members.length)
            _groups.push(new Group(
                new Array(members.length)
                    .fill(1)
                    .map((_v, i) => members[i]),
                new Place(-1, 'Lainnya', 0, 0)
            ))
        }

        const updatedMembers: Member[] = []
        for (const group of _groups) {
            group.members.sort((a, b) => a.name.trim() == ''
                ? 1
                : a.name.localeCompare(b.name)
            )
            for (const member of group.members) {
                if (member.id >= 0) updatedMembers.push(new Member(
                    member.id,
                    member.name,
                    [...member.lastPlacesIds],
                    member.fixedPlaceId
                ).setNewPlace(group.place.id))
            }
        }

        setTimeout(() => {
            setGroups(_groups)
            setIsLoading(false)
            updatedMembers.sort((a, b) => a.name.localeCompare(b.name))
            setStore('data', 'members', updatedMembers)
            files.data.setCache('members', updatedMembers.map(m => m.toJSON()))
            files.data.syncCache()
            addToHistory()
            setIsInitialize(false)
        }, 3E3)
    }

    function dateFormat$YYYY_MM_DD(date: Date): string {
        return `${date.getFullYear()}`.padStart(4, '0')
            + '-'
            + `${date.getMonth() + 1}`.padStart(2, '0')
            + '-'
            + `${date.getDay() + 3}`.padStart(2, '0')
    }

    async function exportAs(): Promise<void> {
        const d = new Date()
        const filePath = await save({
            defaultPath: store.settings.defaultSaveFilePath,
            title: `random-piket_${
                dateFormat$YYYY_MM_DD(d)
            }-${
                `${d.getHours()}`.padStart(2, '0')
            }${
                `${d.getMinutes()}`.padStart(2, '0')
            }${
                `${d.getSeconds()}`.padStart(2, '0')
            }`,
            filters: [
                { name: 'Text', extensions: ['txt'] },
                { name: 'Comma Separated Value', extensions: ['csv'] },
            ]
        });

        if (!filePath) return

        if (!/\.(?:csv|txt)$/gms.test(filePath)) return

        let text = '';
        switch (filePath.match(/(?<=\.)(?:csv|txt)$/gms)![0]){
            case 'csv': {
                text = 'Tempat,Anggota\n' + groups.map(
                    g => g.members.map(
                        m =>
                            (/,/gms.test(g.place.name) ? `"${g.place.name}"` : g.place.name) +
                            ',' +
                            (/,/gms.test(m.name) ? `"${m.name}"` : m.name)
                    ).join('\n')
                ).join('\n')
                break;
            }
            case 'txt': {
                text = groups.map(g => g.place.name + '\n' + g.members.map(m => '• ' + m.name).join('\n')).join('\n\n')
                break;
            }
        }

        setStore('settings', 'defaultSaveFilePath', filePath)
        files.settings.setCache('defaultSaveFilePath', filePath)
        files.settings.syncCache()
        invoke('save_as_file', {path: filePath, text: text})
    }

    onMount(() => {
        setBackupMembers([...store.data.members])
    })

    createEffect(generateRandom)

    const TopBarEl = () => {
        return (<header class={styles.topBar}>
            <div class={topBarStyles.topBarLeading}>
                <button onClick={goToHomePage} title='Kembali' disabled={isLoading()}>
                    <svg class='icon' xmlns="http://www.w3.org/2000/svg" viewBox="0 -960 960 960"><path d="m286-452 232 232-39 40-299-299 301-301 39 40-234 234h494v54H286Z" /></svg>
                    <span>Kembali</span>
                </button>
                <button title='Print' onClick={print} disabled={isLoading()}>
                    <svg class='icon' xmlns="http://www.w3.org/2000/svg" viewBox="0 -960 960 960"><path d="M644-618v-124H316v124h-54v-178h436v178h-54Zm-474 54h620-620Zm510.5 120q20.5 0 35-15t14.5-35.5q0-20.5-14.375-35T680-544q-20 0-35 14.375T630-494q0 20 15 35t35.5 15ZM644-186v-140H316v140h328Zm54 54H262v-154H116v-238q0-38.9 27.5-66.45Q171-618 210-618h540q38.9 0 66.45 27.55Q844-562.9 844-524v238H698v154Zm92-208v-183.616Q790-541 778.787-552.5 767.575-564 751-564H210q-17 0-28.5 11.5T170-524v184h92v-40h436v40h92Z" /></svg>
                    <span>Print</span>
                </button>
                <button title='Ekspor' onClick={exportAs} disabled={isLoading()}>
                    <svg class='icon' xmlns="http://www.w3.org/2000/svg" viewBox="0 -960 960 960"><path d="M452-336v-341l-98 98-39-37 164-164 164 164-39 37-98-98v341h-54ZM266-180q-36.725 0-61.363-24.637Q180-229.275 180-266v-90h54v90q0 12 10 22t22 10h428q12 0 22-10t10-22v-90h54v90q0 37-24.638 61.5Q730.725-180 694-180H266Z" /></svg>
                    <span>Expor</span>
                </button>
                <button title='Copy' onClick={() => copyAll()} class={styles.topBarLeadingCopy} disabled={isLoading() || isCopiedAll()}>
                    <Show when={!isCopiedAll()} fallback={<>
                        <svg class='icon' xmlns="http://www.w3.org/2000/svg" viewBox="0 -960 960 960"><path d="m422-312 270-270-38-38-232 232-116-116-38 38 154 154Zm58.174 212q-78.814 0-148.212-29.911-69.399-29.912-120.734-81.188-51.336-51.277-81.282-120.595Q100-401.012 100-479.826q0-79.07 29.97-148.694 29.971-69.623 81.348-121.126 51.378-51.502 120.594-80.928Q401.128-860 479.826-860q79.06 0 148.676 29.391 69.615 29.392 121.13 80.848 51.516 51.457 80.942 121.018Q860-559.181 860-480.091q0 79.091-29.391 148.149-29.392 69.059-80.835 120.496-51.443 51.436-120.987 81.441Q559.244-100 480.174-100ZM480-154q136.513 0 231.256-94.744Q806-343.487 806-480t-94.744-231.256Q616.513-806 480-806t-231.256 94.744Q154-616.513 154-480t94.744 231.256Q343.487-154 480-154Zm0-326Z" /></svg>
                        <span>Tersalin</span>
                    </>}>
                        <svg class='icon' xmlns="http://www.w3.org/2000/svg" viewBox="0 -960 960 960"><path d="M375-262q-36.725 0-61.362-24.638Q289-311.275 289-348v-424q0-36.725 24.638-61.362Q338.275-858 375-858h304q36.725 0 61.362 24.638Q765-808.725 765-772v424q0 36.725-24.638 61.362Q715.725-262 679-262H375Zm0-54h304q12 0 22-10t10-22v-424q0-12-10-22t-22-10H375q-12 0-22 10t-10 22v424q0 12 10 22t22 10ZM241-128q-36.725 0-61.363-24.637Q155-177.275 155-214v-478h54v478q0 12 10 22t22 10h358v54H241Zm102-188v-488 488Z" /></svg>
                        <span>Salin</span>
                    </Show>
                </button>
            </div>
            <button class={topBarStyles.topBarTrailing} onClick={() => { setIsLoading(true) }} disabled={isLoading()}>
                <svg class="icon" xmlns="http://www.w3.org/2000/svg" viewBox="0 -960 960 960"><path d="M201-341q-16-31-25.5-66t-9.5-72q0-123 82.5-213.5T452-794h68l-78-78 39-39 144 144-144 144-39-37 79-79h-68q-96 8-164.5 81.5T220-479q0 26 5.5 51.5T240-380l-39 39ZM479-53 335-197l144-144 39 37-79 79h68q96-8 164.5-81.5T740-485q0-26-5.5-51.5T720-584l39-39q16 31 25.5 66t9.5 72q0 123-82.5 213.5T508-170h-68l78 78-39 39Z" /></svg>
                <span>Buat</span>
            </button>
        </header>)
    }

    const BodyEl = () => {
        return (<main>
            <Show
                when={!isLoading()}
                fallback={<div class={styles.loading}>
                    <svg class="icon" xmlns="http://www.w3.org/2000/svg" viewBox="0 -960 960 960"><path d="M201-341q-16-31-25.5-66t-9.5-72q0-123 82.5-213.5T452-794h68l-78-78 39-39 144 144-144 144-39-37 79-79h-68q-96 8-164.5 81.5T220-479q0 26 5.5 51.5T240-380l-39 39ZM479-53 335-197l144-144 39 37-79 79h68q96-8 164.5-81.5T740-485q0-26-5.5-51.5T720-584l39-39q16 31 25.5 66t9.5 72q0 123-82.5 213.5T508-170h-68l78 78-39 39Z" /></svg>
                    <h2>SEDANG MEMPROSES</h2>
                </div>}
            >
                <div class={styles.printTitle}>
                    <div>
                        <img src="data:image/jpeg;base64," alt="" />
                        <div>
                            <h3>ORGANISASI SANTRI MA'HAD AL I'TISHAM</h3>
                            <p>Pondok Pesantren Al I'tisham, Kampus Putra, Gg. Wijayakusuma 140, Kepek 1, Wonosari, Gunungkidul, D.I. Yogyakarta</p>
                        </div>
                        <img src="data:image/jpeg;base64," alt="" />
                    </div>
                    <div>
                        <h3>JADWAL PIKET SANTRI PUTRA</h3>
                        <p>{new Date().toLocaleDateString('id', { day: 'numeric', month: 'long', year: 'numeric' })}</p>
                    </div>
                </div>
                <div class={styles.results}>
                    <For each={groups}>{(group, index) =>
                        <div class={styles.group} onClick={ev => copy(ev, index())}>
                            <div class={styles.groupCopiedMessage}>
                                <svg class='icon' xmlns="http://www.w3.org/2000/svg" viewBox="0 -960 960 960"><path d="M375-262q-36.725 0-61.362-24.638Q289-311.275 289-348v-424q0-36.725 24.638-61.362Q338.275-858 375-858h304q36.725 0 61.362 24.638Q765-808.725 765-772v424q0 36.725-24.638 61.362Q715.725-262 679-262H375Zm0-54h304q12 0 22-10t10-22v-424q0-12-10-22t-22-10H375q-12 0-22 10t-10 22v424q0 12 10 22t22 10ZM241-128q-36.725 0-61.363-24.637Q155-177.275 155-214v-478h54v478q0 12 10 22t22 10h358v54H241Zm102-188v-488 488Z" /></svg>
                                <p>Tersalin</p>
                            </div>
                            <div class={styles.groupContent}>
                                <h3>{group.place.name}</h3>
                                <ul>
                                    <For each={group.members}>{member =>
                                        <li>{member.name}</li>
                                    }</For>
                                </ul>
                            </div>
                        </div>
                    }</For>
                </div>
            </Show>
        </main>)
    }

    return (<>
        <TopBarEl />
        <BodyEl />
    </>)
}